const results = [];

for (let i = 0; i < items.length; i++) {
  const project = items[i].json;

  const name = project.name || '';
  const category = project.category?.name || '';
  const url = project.url || '';

  const reward = project.rewards?.[i]; // assuming 1 reward per item, at index 0
  const rewardDescription = reward?.description || reward?.reward || '';

  results.push({
    json: {
      name,
      category,
      rewardDescription,
      url
    }
  });
}

return results;

const rewards = $input.first().json.rewards || [];

const rewardDescriptions = rewards.map(r => r.description || r.reward || '').filter(Boolean);

return [
  {
    json: {
      rewardDescriptions
    }
  }
];

const seen = new Set();
const uniqueProducts = [];

for (const item of items) {
  const product = item.json;
  const title = product.title?.toLowerCase().trim();

  if (!seen.has(title)) {
    seen.add(title);
    uniqueProducts.push({
      json: {
        title: product.title,
        price: product.price,
        image: product.images?.[0] || '',
        url: product.url,
        description: product.description || '',
        productType: product.product_type || ''
      }
    });
  }
}

return uniqueProducts;

const results = [];

for (const item of items) {
  const creator = item.json["Creator Name "] || '';
  results.push({
    json: {
      searchQuery: `site:linkedin.com/in ${creator} founder`
    }
  });
}

return results;

